import React from "react";

const Footer = () => {
    return (
        <div className="container-fluid bg-warning">
            <div className="row">
                <div className="col-sm-10 mx-auto text-center">
                    <div className="jumbotron rounded-0 bg-dark text-light">
                        <p>Join the class social group</p>
                        <div>
                            <i class="fa fa-facebook text-primary bg-"></i>
                        </div>
                    </div>

                </div>
            </div>
        </div>
    );
};

export default Footer;
